INSERT INTO `article` VALUES (2, '凡人修仙战：“普天王”VS阿祖', '从白到黑，亚锦赛的第一天正赛不可谓不漫长，在这黑与白的交替中，普兰诺伊和陆光祖的比赛，回馈了那些熬到深夜的资深球迷。\r\n32岁的老普，28岁的阿祖，奉献了这一天最漫长也是最跌宕起伏的战斗。在长达90分钟的拉锯中，上演了属于各自巴黎奥运周期最后一站积分赛的浓墨重彩。\r\n实际上，这场比赛，相对于今天很多差距过大虐菜局，本身就潜藏了一些悬念，32岁的老普，在他的职业生涯中，虽然没有取到单项赛的耀眼成绩，但却因为曾经击败过林李，桃田，以及在2022总决赛2023世锦赛双杀屠龙而成为球迷口中“不斩无名之辈”的普天王。\r\n28岁的阿祖，在国羽的强大的竞争环境之下，始终未能进入顶尖选手的行列，但他敢打敢拼，在赛场上为每一个球积极跑动追分，为每一场可能的胜利全力以赴，博得球迷得赞赏。弹幕中有一句话我觉得贴切大意是：“阿祖是凡人所能做到的最好的模样”。\r\n而在第一场对决中，两人的风格与战术就已经表现明显不同，手持99P的阿祖，在后场频频发动强攻，进攻的号角几乎持续了整局，这时他并不依赖于对手的破绽，而是像排球少年中的重炮手牛若一样“给我一个高球就足够了”。老普则是拿了一把极音速，在单打选手中持速度拍并不多见。但从战术可以看出来，在网球前快速抢网创造机会，在中后场连贯进攻，通过打点打线路得分是他的整场策略。但第一局老普在网前出现较多失误，并且第一局的阿祖体力在最佳状态，老普的进攻，在阿祖的跑动与防守下收效甚微。最终在不断的追分中以17比21结束第一局。这个时候，已近转钟，或许宁波的观众都在期待阿祖两局拿下，然后回家洗洗睡了。\r\n但换边之后的老普显然并没有给大家让这个愿望顺利实现的机会。主动提速，在网前勾对角和放网也开始变得精准，6比1的梦幻开局让这个夜晚又开始加钟。不过阿祖也并没有在此时选择“收手”和慌张。一波高质量的放网，在后场正手直线和头顶斜线都取得了分数。并且在互相的后场控制中老普先开始手软，阿祖最终实现抓住机会连续得分，8比7的反超并以11比8进入间歇。\r\n但在间歇之后，老普的调整是肉眼可见的，接发抢网快推加速想拉回差距，但是阿祖也非泛泛之辈。仅仅给了他一分的表现，就再度通过拉开进攻让比分来到9比13。\r\n不过在这个时候，老普找到了此时阿祖的破绽，反手摆脱的不足，通过连续控制反手区，不仅让他过渡失误，并且创出了了杀上网得分的机会。并且在11比14落后时。两人一个长达49拍的拉锯，最终以阿祖的杀球下网结束，这个消耗了双方体能的球是这局的关键。在这个球之后阿祖的速度稍微变慢，并且在进攻端出现失误，14比16之后，老普通抢网，变速控反手等手段打出了一波6比0的高潮来到局点。一般来说，这种局面阿祖选择保守打法，保留体力打第三局是常规的战术选择。\r\n但这是阿祖不变且让人欣赏的一点，无论在什么分数的时候，他都没有放弃过奔跑与追逐。两人仿佛角色互换，阿祖开始了抢网与进攻，并且在20比19时，阿祖面对老普一个高质量放网，一个快拨斜线的得分表现了他敢打敢拼无畏。也让比赛来到了20平的焦灼。\r\n但老普的经验在此时发挥了作用，他在关键分的发后场，与在头顶区的一拍强攻多少都有点出其不意，也结束了在这连续追6分拿到局点，换一方连续追5分拿到赛点的焦灼局面。\r\n在第三局，间歇之后，阿祖显然是提高了专注度，一个霸气的中场拦截化解了普的停顿拿到了第一份。并连续得分获得5比1的优势开局。两人在8比3时老普有个不可思议的防守。两个中场追身被连续防起，但阿祖的连续进攻也拒绝了老普的得分。9比3的比分让局势开始向阿祖倾斜。11比5进入决胜局间歇，这对于老普或许是有些无奈的。\r\n但在换边之后，两人都选择较为保守的打法，速度趋于平缓。但在这平缓的节奏中，是阿祖先出现了波动，老普通过网前与加速突击和控反手在很短的回合中快速追回分数，期间阿祖仅通过擦网拿分并出现一些非受迫性失误。这期间并没有产生什么激烈的回合跟无数普通胡比赛如出一辙。毕竟是两个凡人在打架，一定会出现这样的阶段，但戏剧性的是在这样平凡过渡中，一波8比1两人又回到了同一起点。没有谁能势如破竹的打开僵持局面。\r\n在14平之后，两人在网前展开胃激烈的争夺，客观的说，前两局在近网的表现应该是老普略占优势，孙教练也在指导过程中多次提到挡远网。但在决胜局后半段，两人的网前可以说平分秋色。老普有滚网，阿祖也有扑球得分。就在这样的网口争夺战中，比分交替上升到19平。\r\n在关键的时刻，老普一个正手底线回球出现了腿软失误，这个时候比赛已经接近90分钟，对于快32岁的老普来说，体能是一个极致的考验。但是稍微调整后20比19赛点分，老普仍然敢于坚决连续放网最终得分，拉到20平。\r\n阿祖同样是临危不乱，再次控制老普出现腿软的正手底线，拿到赛点。但是当普再追一分拿到21平后，经验和心态发挥了作用，在阿祖并不算弱的后场火力下，连续两次发后场，第一次在回合之中找到破绽，高高跃起杀斜线拿到赛点。最后一个后场则是阿祖杀球回位不及结束了比赛。就这样，这场整整90分钟的比赛，定格在了决胜局23比21。老普艰难的取得胜利。\r\n其实在拉克什亚淘汰后，老普已经稳稳地拿住了奥运会的名额。而阿祖在石头和李师傅的竞争下已经早早告别了巴黎的门票。\r\n在这样一场看似无关紧要的比赛中，全力以赴的两个凡人打出了“神仙打架”的气势。虽然他们没有任何一个人会因为这场比赛留名青史，甚至在这站亚锦赛中，这也不会是最受关注的比赛，但这样的发挥和表现，在灯光没有那么闪亮的地方用力发光，至少没有辜负宁波的深夜和他们靠努力与坚持造就的羽球生涯。\r\n这个夜晚过后，阿祖和巴黎的联系彻底断开，但他的羽球生涯还在继续，希望他不要“收手”，再打更多值得激动与掌声的比赛。而老普在这场激战过后，也在今天败北，但可以期待他在未来，会为我们奉献更多斩下“有名之辈”的精彩。', 'https://q3.itc.cn/q_70/images01/20240412/4f81aff1f11f4ebe8c27ba0d763160c0.jpeg', 1, 'youtid', '2024-04-12 12:55:14', 120, 0, 0);
INSERT INTO `article` VALUES (3, '怎样稳定球技', '感觉又到瓶颈了，总是练好了一点就漂，这次沉下心练了几天，去球场打又紧张，练了的动作步伐都发挥不出来家人们如何在球场上平稳心态保持水平？', 'https://img.badmintoncn.com/forum/202404/11/214836kvplpdfwpmnoinmp.jpeg?imageView2/2/w/1280/h/1280/format/jpg/interlace/1/q/100|watermark/1/image/aHR0cHM6Ly9pbWcuYmFkbWludG9uY24uY29tL3dhdGVybWFyay5wbmc=/dissolve/100/gravity/SouthWest/dx/5/dy/5|imageslim', 1, 'youtid', '2024-04-18 14:00:11', 12, 0, 0);
INSERT INTO `article` VALUES (4, '日羽财政赤字+战绩下滑 爆朴柱奉奥运后不获续约', '（东京22日综合电）据日本媒体报道，日本羽协日前透露连续两年深陷财政赤字3亿日元（约1450万人民币），因此在巴黎奥运会后将对队伍和管理进行调整，缩小派遣参赛。与此同时，亦有传言日本羽毛球队总教练朴柱奉亦将在巴黎奥运会后不再获续约。\r\n日本料缩小派遣参赛队伍\r\n日本羽协在巴黎奥运之前，原则上将保持目前的强化方针，全力支持日本代表，但在巴黎奥运会后，将彻底检讨代表派遣，缩小合宿、远征等活动。此外，为迎接4年后的洛杉矶奥运会，将继续进行青少年的强化培训。\r\n另外，韩国籍名教头朴柱奉自2004年雅典奥运会后上任日本羽毛球队总教练至今，多次带领日本羽毛球队创造历史，包括夺得汤杯冠军和赢得奥运会金牌，但随着日本羽毛球队兵败主场的东京奥运会及近来表现已不如之前辉煌，传言他将年巴黎奥运会不再获续约。\r\n如果朴柱奉离开日本羽毛球队，预料将被其他球队争相聘请。而由于日本羽协的变化，预计在巴黎奥运会后的国际羽坛整体格局，或将出现中韩争霸的局面。', 'https://q3.itc.cn/images01/20240108/b5ccd11d16b34b2b94cd52507c89ae12.jpeg', 22, 'youtid', '2024-04-18 14:00:40', 32, 0, 0);
INSERT INTO `article` VALUES (5, '巴黎100中法羽毛球慈善盛典即将开幕', '2024年是中法两国建交60周年，也恰逢奥运盛会在巴黎举行。在这场体育盛会中，浪漫之都巴黎成为全世界的焦点，万众瞩目。在这样一个极具历史意义的节点，由羽毛球国际巨星，羽毛球双圈全满贯，奥运冠军林丹发起的“巴黎100中法羽毛球慈善盛典”应运而生。即将在浪漫之都巴黎，在塞纳河畔，在巴黎中心—埃菲尔铁塔上拉开帷幕。\r\n4月17日-18日，巴黎奥运会倒计时100天之际，羽毛球四大天王林丹、李宗伟、陶菲克、盖德将在巴黎世纪聚首，上演传奇表演赛，经典重现。同时，他们还将与来自世界各国的青少年羽毛球运动员、法国国家队羽毛球运动员及中法演艺界明星代表进行羽毛球表演互动，与社会各界人士共襄盛会。\r\n本次盛典的举办地点极具代表意义，将在埃菲尔铁塔内距离地面57米高的GUSTAVE EIFFEL LOUNGE内进行。置身其中巴黎景色一览无余，尽收眼底。这也是埃菲尔铁塔历史上第一次举办羽毛球比赛，令人瞩目！\r\n在为期两天的盛典中，不仅有万众期待的天王表演赛，还将进行隆重的慈善拍卖会和晚宴，所得收入扣除开支后，将全数捐赠至由“羽毛球传奇四大天王”所指定的羽毛球发展机构，以促进羽毛球运动的发展。\r\n据盛典主办方巴黎100组委会主席梁慧仪介绍，拍卖环节将由赞助企业、企业家、羽联、运动员及艺术家捐赠限量纪念的珍藏品以及名人、运动员亲笔签名物品等。有林丹2008年北京奥运会夺冠使用的AT700签名球拍、2014年仁川亚运会夺冠使用的VOLTRIC Z-FORCE II签名球拍，李宗伟2016夺得里约奥运会亚军的Duora10签名球拍，盖德2009年-2010年征战的签名球衣、2010年巴黎世锦赛使用的ARCSABER 10 PG签名球拍，陶菲克职业生涯的最后一款签名球衣。还要特别感谢两届网球大满贯得主李娜、北京冬奥会单板滑雪冠军苏翊鸣、乒乓球初代大魔王邓亚萍，他们为此次盛典分别捐赠了签名网球拍、签名滑雪板和签名乒乓球拍等，这些装备镌刻着运动员征战赛场的荣耀时刻！除此之外，还有著名画家、书法家范曾先生的画作，世界三大影响力人物“埃隆.马斯克、杰夫.贝佐斯、比尔.盖茨”的联合亲笔签名纪念币、巴黎奥运会羽毛球总决赛门票等等。\r\n本次盛典特别感谢中国驻法国大使馆、法国驻广州总领事馆、法国羽毛球协会及深圳羽毛球协会的全力支持。期待在中法建交60周年和巴黎奥运会开幕倒计时100天这样具有双重纪念意义的时刻，通过举办“巴黎100中法羽毛球慈善盛典”，发挥中国体育力量，激励世界各地的年轻人挑战自我，奋勇向前。为奥运加油，为体育助力！让大家共同感受运动带来的力量。', 'https://q9.itc.cn/images01/20240415/fc3aa94ea669479e862fbad4d70e31f7.png', 22, 'youtid', '2024-04-18 14:02:20', 110, 0, 0);
INSERT INTO `article` VALUES (6, '何冰娇锁定奥运席位 携手陈雨菲勇闯巴黎', '尽管何冰娇与韩悦双双不敌队友止步亚锦赛女单四强，但这也意味着何冰娇正式锁定了巴黎奥运会参赛资格。在东京奥运会收获女单第四名的何冰娇，将携手在东京奥运会摘得女单冠军的陈雨菲，一起奔赴巴黎再战奥运。\r\n在昨天分别击败外协会选手后，国羽时隔十二年再度包揽亚锦赛女单四强，提前两天收获冠军，于是女单赛场最大悬念变成了——何冰娇与韩悦谁能搭上巴黎奥运会的末班车？\r\n根据去年5月29日中国羽协发布的《羽毛球项目2024年巴黎奥运会参赛运动员、教练员选拔办法 》规定，如果某个单项获取的参赛资格为三个或多余三个，首先会依据 2024 巴黎奥运会参赛资格排名截止前的世界排名(奥运排名)，排名高的优先获取参赛资格。\r\n在本届亚锦赛开赛前，国羽一姐陈雨菲已经早早锁定了女单参赛席位，而另一个参赛席位将在奥运积分排名第六的何冰娇、第七的韩悦、第九的王祉怡三人之间产生。\r\n其中王祉怡想要在积分上超越何冰娇和韩悦，首要条件是在她之前的这两位队友止步八强，但随着昨天比赛的结束，三人同时晋级四强，就已经意味着王祉怡告别了奥运竞争。\r\n接下来就看何冰娇与韩悦谁能够走得更远了，两人之间的分差在开赛前是1158分，如果同轮次淘汰，何冰娇依旧保持优势直通巴黎，如果韩悦能够更进一步，那便是韩悦后来者居上首次拿到奥运资格。\r\n女单今天的两场半决赛内战，是何冰娇率先迎战王祉怡。昨天力克头号种子安洗莹的何冰娇由于耗费了太多精力，今天在场上显得有些疲劳，失误也比较多，最终是打得更从容更果断的王祉怡2比0获胜，晋级到决赛。\r\n止步于此后，何冰娇能否拿到奥运资格就要看韩悦的比赛结果了，所以打完之后她还是很紧张，也有点遗憾：“紧张是有的，但这场比赛也尽全力了。只是有点后悔去年前半段奥运积分赛能把握得更好一些就好了。因为去年有些伤病，有些退赛，总决赛也没打上，受伤了也想练，总跟自己较劲，整体是蛮可惜的。”\r\n当何冰娇紧张等待另一场女单内战开启时，韩悦的心态则是尽量保持着平静：“何冰娇在我前面一场，我知道了她的结果，没什么想法，不管她输赢，自己还是不想想那么多。”\r\n虽然心态放得很好，但韩悦面对的毕竟是一姐陈雨菲，而这几天，陈雨菲也把队友们的竞争看在眼里：“对，这两天都是关于奥运竞争的声音，我也看到他们的求生欲，大家都想去奥运会，毕竟这是非常盛大的赛事，但我不管对手是谁，就算今天是何冰娇，我也是全力以赴做好自己。”\r\n最终这场比赛，依然是陈雨菲技高一筹，韩悦虽然心态放得很好，但多拍上的主动失误还是多了一些，也是以0比2的比分输给队友，止步四强。这样一来，同轮次折戟之下，是何冰娇积分领先，确保了自己的奥运席位。\r\n距离自己的首次奥运之旅还是差了一点，没有遗憾是不可能的，但韩悦还是能够积极看待：“肯定比较可惜，但我也可以接受，本来我也是后来者居上，所以差了一点也没有关系，而且这一站自己也尽力了，挺圆满的。”\r\n于是，时隔三年，不出意外的话，何冰娇又将和陈雨菲代表国羽女单出征奥运。三年前的东京奥运会，二人在半决赛相遇，陈雨菲获胜杀入决赛，并力克中国台北名将戴资颖摘得桂冠，而何冰娇在和印度名将辛杜的铜牌争夺站中遗憾失利。\r\n双双晋级奥运四强，拿到第一和第四的成绩，是中国女单在东京奥运会上交出的满意答卷，就看今夏的巴黎，两朵金花能否继续闪耀在塞纳河畔。', 'https://resource.ttplus.cn/publish/app/data/2024/04/13/512558/5ee06199-3f67-47ec-8a5e-93684b861904.jpg', 22, 'youtid', '2024-04-13 17:00:11', 0, 0, 0);
